


RNA=""

n = 3 #codon --> 3 character
Codon=[]
for i in range(0, len(RNA), n): #0,3,6,9......
    Codon.append(RNA[i:i+n]) #[0:3], [3:6] .....

#print(Codon)
Protein=[]
for i in Codon:
    if i in ["UUU","UUC"]:
        Protein.append("F")

    elif i in ["UUA","UUG","CUU","CUC","CUA","CUG"]:
        Protein.append("L")

    elif i in ["UCU","UCC","UCA","UCG","AGU","AGC"]:
        Protein.append("S")

    elif i in ["UAU","UAC"]:
        Protein.append("Y")

    elif i in ["UAA","UAG","UGA"]:
        break

    elif i in ["UGU","UGC"]:
        Protein.append("C")

    elif i in "UGG":
        Protein.append("W")

    elif i in ["CCU","CCC","CCA","CCG"]:
        Protein.append("P")

    elif i in ["CAU","CAC"]:
        Protein.append("H")

    elif i in ["CAA","CAG"]:
        Protein.append("Q")

    elif i in ["CGU","CGC","CGA","CGG","AGA","AGG"]:
        Protein.append("R")

    elif i in ["AUU","AUC","AUA"]:
        Protein.append("I")

    elif i in "AUG":
        Protein.append("M") 

    elif i in ["ACU","ACC","ACA","ACG"]:
        Protein.append("T")

    elif i in ["AAU","AAC"]:
        Protein.append("N")

    elif i in ["AAA","AAG"]:
        Protein.append("K")
    
    elif i in ["GUU","GUC","GUA","GUG"]:
        Protein.append("V")
    
    elif i in ["GCU","GCC","GCA","GCG"]:
        Protein.append("A")

    elif i in ["GAU","GAC"]:
        Protein.append("D")

    elif i in ["GAA","GAG"]:
        Protein.append("E")

    elif i in ["GGU","GGC","GGA","GGG"]:
        Protein.append("G")



a="".join(Protein)
print(a)